import React from 'react';
import { Grid } from 'semantic-ui-react';
import MenuButton from '../../components/menuButton.component';

export default class DossierComponent extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      taskList: [{
        name: "TN 20131441",
        id: "19920a3dd"
      },
      {
        name: "TR 20145323",
        id: "127226rf3"
      }]
    }
  }
  render() {
    return (
      <Grid
        textAlign="center"
        style={{ height: '100vh' }}
        verticalAlign="top"
      >
        <Grid.Column style={{ maxWidth: "90vw" }}>

          {this.state.taskList.map(task => (
            <MenuButton style={{ margin: '1em' }}
              key={task.id} name={task.name} link={"mes-dossiers/" + task.id} color="white" />
          ))}

        </Grid.Column>
      </Grid >

    );
  }
}
